import React from "react";
import { NavLink } from "react-router-dom";
import { logo, basket, account } from "../assets/index.js";
import "./Styles/styles.css";

export const Navbar = () => {
  return (
    <nav className="navbar">
      <NavLink className="logo-nav" to="/">
        <img alt="logo" className="logo" src={logo} />
      </NavLink>
      <NavLink to="/sneakers/men" className="nav">
        <p>Men</p>
      </NavLink>
      <NavLink to="/sneakers/women" className="nav">
        <p>Women</p>
      </NavLink>
      <NavLink to="/sneakers/kids" className="nav">
        <p>Kids</p>
      </NavLink>
      <NavLink to="/sneakers/favorites" className="nav">
        <p>Favorites</p>
      </NavLink>
      <div className="icons-nav">
        <NavLink to="/auth/account" className="icon-nav">
          <img alt="account-icon" src={account} className="icon" />
        </NavLink>
        <NavLink to="/auth/basket" className="icon-nav">
          <img alt="basket-icon" src={basket} className="icon" />
        </NavLink>
      </div>
    </nav>
  );
};
